    mooseError(
        "Cannot specify both primary emissivity and primary emissivity temperature function");
  if (isParamValid("secondary_emissivity") && _eps_secondary_temperature_function)
    mooseError(
        "Cannot specify both secondary emissivity and secondary emissivity temperature function");
}

Real
FunctionGapFluxRadiation::emissivity() const
{
  GapFluxModelRadiationBase::emissivity();
  if (_eps_primary_temperature_function && _eps_secondary_temperature_function)
  {
    const Real qp_primary_T = MetaPhysicL::raw_value(_primary_T[_qp]);
    const Real qp_secondary_T = MetaPhysicL::raw_value(_secondary_T[_qp]);
    if (_eps_primary_temperature_function->value(qp_primary_T) == 0 &&
        _eps_secondary_temperature_function->value(qp_secondary_T) == 0)
      return 0;

    switch (_coord_system)
    {
      case Moose::COORD_XYZ:
        return 1 / (1.0 / _eps_primary_temperature_function->value(qp_primary_T) +
                    1.0 / _eps_secondary_temperature_function->value(qp_secondary_T) - 1);

      case Moose::COORD_RZ:
      {
        Real eps_primary = _eps_primary_temperature_function->value(qp_primary_T);
        Real eps_secondary = _eps_secondary_temperature_function->value(qp_secondary_T);
        const auto primary_r = _primary_point.point(_radial_coord);
        const auto secondary_r = _secondary_point.point(_radial_coord);
        const bool primary_is_inner = primary_r < secondary_r;
        const auto inner_r = primary_is_inner ? primary_r : secondary_r;
        const auto outer_r = primary_is_inner ? secondary_r : primary_r;
        const auto inner_eps = primary_is_inner ? eps_primary : eps_secondary;
        const auto outer_eps = primary_is_inner ? eps_secondary : eps_primary;

        // Taken from our documentation of FVInfiniteCylinderRadiativeBC
        return inner_eps * outer_eps * outer_r /
               (outer_eps * outer_r + inner_eps * inner_r * (1 - outer_eps));
      }

      default:
        mooseError("spherical coordinates not yet supported for this object");
    }
  }
  return 0;
}

ADReal
FunctionGapFluxRadiation::computeFlux() const
{
  return computeRadiationFlux(_secondary_T[_qp], _primary_T[_qp]);
}
